              areaData.dataPoints[Math.ceil(areaData.dataPoints.length / 2)].y >
              0;
            let maxY = -Infinity;
            let minY = +Infinity;
            const diff = areaEndLocalization - areaStartLocalization;
            const xValue = (areaEndLocalization + areaStartLocalization) / 2;
